e. The collimator and image intensifier must be adjusted so that the measured difference between the x-ray field and visible image area is less than 2% SID',1,'2012-10-19 12:36:52','2012-11-27 11:50:19','Complete','400105114408'),(2338,1263,'High contrast resolution did not meet the minimum desired specification in any imaging mode. The imaging chain should be checked and adjusted.',1,'2012-10-19 12:37:00','2012-11-27 11:50:19','Complete','400105114408'),(2339,1263,'A copy of the fluoroscopic skin entrance doses (attached) must be posted on the unit in a location visible to the operator (DHEC RHB 4.9.4.5.6).',0,'2012-10-19 12:37:17',NULL,'New',''),(2340,1259,'A copy of the fluoroscopic skin entrance doses (attached) must be posted on the unit in a location visible to the operator (DHEC RHB 4.9.4.5.6).',1,'2012-10-22 16:16:33','2012-10-23 13:27:09','Complete',''),(2341,1259,'DHEC RHB 4.9.1.3 requires a minimum SSD of 30 cm for portable fluoroscopy units. The spacer cone provided with the unit must be left on when the unit is being used.',1,'2012-10-22 16:16:45','2012-10-23 13:27:09','Complete',''),(2342,1244,'Exposure linearity failed due to fluctuations in generator kV. The generator should be calibrated and checked.',1,'2012-10-23 13:28:41','2012-10-23 13:29:01','Complete','400105080628'),(2343,1267,'Measured kV was 94.5 which is higher than the set value of 85 kV. Generator kV calibration should be checked and adjusted.',0,'2012-10-31 10:10:48',NULL,'New',''),(2344,1271,'The DHEC registration tag was not present on the system.  Registration information has been forwarded to the Radiation Safety Office who will register the unit with DHEC. Once the registration sticker has been received, it must be placed on the control console in a visible location.',0,'2012-11-09 11:48:41',NULL,'New',''),(2345,1271,'A technique chart was not posted in the room.  A technique chart reflecting techniques currently used with the DR system must be provided (DHEC RHB 4.2.8).',0,'2012-11-09 11:48:49',NULL,'New',''),(2346,1271,'A pregnant patient warning sign must be posted on the door or in the room in a visible location.',0,'2012-11-09 11:48:55',NULL,'New',''),(2347,1271,'The SID indicator on the collimator housing does not indicate SID to the wall bucky and shows a distance of 115cm regardless of where the tube is moved. This should be corrected so that the correct SID to the wall bucky is indicated. If this is normal behaviour for the unit, marks indicating the 40\" and 72\" distances to the wall bucky must be placed on the unit.',0,'2012-11-09 11:49:01',NULL,'New',''),(2348,1271,'A Radiation Area warning sign must be posted on the door to the room.',0,'2012-11-09 11:49:08',NULL,'New',''),(2349,1271,'The table and wall bucky phototimers did not track well with changing kV. The phototimer calibration should be checked and adjusted.',0,'2012-11-09 11:49:14',NULL,'New',''),(2350,1271,'Distance between the center of the radiation field and the image receptor was 1.73 cm in the cross-table direction for the table bucky. This is close to but still within the 2% SID limit. The location of the x-ray tube should be adjusted so that it is more centered on the bucky tray.',0,'2012-11-09 11:49:21',NULL,'New',''),(2351,1270,'Compression release drive slips when initially moved up or down.',0,'2012-11-09 15:06:57',NULL,'New',''),(2352,1270,'The organ dose values reported at the operator workstation are much lower than what was measured for large focal spot exposures, 1.76 mGy compared to 1.06 mGy reported by the system. The organ dose reported by the system may need to be recalibrated.',0,'2012-11-09 15:07:11',NULL,'New',''),(2353,1276,'The exposure chart in this report must be posted on the unit in a visible location.',0,'2012-11-30 10:01:41',NULL,'New',''),(2354,1276,'The lever arms are missing from the collimator control box making collimation adjustments difficult. Replacement lever arms should be obtained.',0,'2012-11-30 10:01:59',NULL,'New',''),(2355,1276,'Due to the overhead location of the x-ray tube, radiation exposure to the operator from scattered radiation can be significant.  Scatter exposure rates of up to 1.2 mGy/h in normal mode were measured for a 20 cm thick phantom. Operators should be aware of this and wear the appropriate protective apparel.',1,'2012-11-30 10:02:09','2012-11-30 10:02:09','New','');
